import React from 'react';

const Projects = () => (
  <section className="projects">
    <h2>Projects</h2>
    <div className="project">
      <h3>Flight Reservation App</h3>
      <p>Built a Java app with TDD practices for booking flights. Tech: Java, JUnit.</p>
    </div>
    <div className="project">
      <h3>ORB-SLAM3 Enhancements</h3>
      <p>Improved vision model accuracy with Python and Docker at SDSU Research.</p>
    </div>
  </section>
);

export default Projects;
